showSelectFiles = function showSelectFiles(_event){

	filelistTag = ''
	selectlist = _event.target.files;
	for(i = 0; i < selectlist.length; ++i){
		selectlist += "<li>"+selectlist[i].name+"</li>";
	}

	filelist = document.getElementById("filelist");
	filelist.innerHTML = filelistTag;
}
